jCastle.oid.extra = {};

/**
 * get an object id by a name.
 * 
 * @public
 * @param {string} name oid name
 * @param {string} comment comment value
 * @param {object} config cert-config object
 * @returns object id.
 */
jCastle.oid.getOID = function(name, comment, config)
{
	name = name.toLowerCase();

	// search in oid_section of the config, if config is given
	if (config && 'oidSection' in config) {
		if (name in config.oidSection) {
			return config.oidSection[name];
		}
	}

	for (var i in jCastle.oid.data) {
		if (jCastle.oid.data[i].name.toLowerCase() == name && !jCastle.oid.data[i].obsolete) {
			if (comment) {
				if (comment == jCastle.oid.data[i].comment) return i;
			} else {
				return i;
			}
		}
	}

	// name is oid
	if (/^[0-9\.]+$/.test(name)) return name;

	return false;
};

/**
 * get a name by an object id.
 * 
 * @public
 * @param {string} oid object id
 * @param {object} config cert-config object.
 * @returns the name for the oid.
 */
jCastle.oid.getName = function(oid, config)
{
	if (config && 'oidSection' in config) {
		for (var i in config.oidSection) {
			if (oid == config.oidSection[i]) {
				return i;
			}
		}
	}

	if (oid in jCastle.oid.data) {
		return jCastle.oid.data[oid].name;
	}

	return false;
};

jCastle.oid.getComment = function(oid)
{
	if (oid in jCastle.oid.data) {
		return jCastle.oid.data[oid].comment;
	}

	return false;
};

jCastle.oid.isObsolete = function(oid)
{
	if (oid in jCastle.oid.data && jCastle.oid.data[oid].obsolete) {
		return true;
	}

	return false;
};

jCastle.oid.isValid = function(oid)
{
	if (oid in jCastle.oid.data) {
		return true;
	}

	return false;
};

jCastle.OID = jCastle.oid;

module.exports = jCastle.oid;
